import { useSelector } from "react-redux";
import { useNavigate } from "react-router-dom";
import store from "../store/store";
import "./Quests.scss"
import { fetchQUEST } from "../actions/fetchQuest"

store.dispatch(fetchQUEST());

const Quests = () => {
  const state = useSelector(state => state.QUEST);
  let navigate = useNavigate();
  const onClickEvent = e => {
    let a = e.target.id;
    console.log(a)

    navigate("/quest/quiz/"+a);
  }
  return (
    <div className="Quest">
        <div className="Content">
            <div className="InnerContent">
            {state.map((i)=>(
                <button className="Botton"  onClick={onClickEvent} id={i.QuestId} >
                    <div className="BottonMainTitle">{i.Name}</div>
                    <div className="BottonContent">{i.Subname}</div>
                </button>
            ))}
                <div className="CASE"></div>
            </div>
        </div>
    </div>
  );
}

export default Quests;
